    "2013-03-19T00:35:19.148289",nt"name": "quaternary-faults-and-folds-in-alaska-a-digital-database",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains information and locations
    on faults and associated folds in Alaska that are believed to be sources of M>6
    earthquakes during the Quaternary (the past 1,600,000 years). The dataset is intended
    to part of the USGS archive for historic and ancient earthquake sources used in
    current and future probabilistic seismic-hazard analyses. This dataset presents
    a single source that summarizes important information on paleoseismic (ancient earthquakes)
    parameters including, age of most recent deformation, slip rate, slip sense dip
    direction, and accuracy of original mapping. These data are compiled from hundreds
    of journal articles, maps, theses, and other documents, as referenced herein. The
    geospatial data coverage for the state of Alaska is designed to serve a variety
    of needs, both in terms of the user community and methods of delivering the data.",nt"license_title":
